import React from "react";
import Deck from ".//Components/Deck";
import Search from "./Components/Search";
import Cards from "./Components/Cards";
import Login from "./Components/Login";
import Navbar from "./Components/Navbar";
import { Grid, Box } from "@chakra-ui/react";

function Home() {
  return (
    <Grid h="100vh" templateRows="1fr 9fr" templateColumns="1fr 4fr">
      <Box>
        <Cards />
      </Box>
      <Box>
        <Login />
      </Box>{" "}
      <Box gridColumn="1 / -1" bg="teal.500">
        <Navbar />
      </Box>
      <Box gridRow="2" gridColumn="1" bg="purple.500" overflowY="auto">
        <Search />
      </Box>
      <Box gridRow="2" gridColumn="2" bg="green.500">
        <Deck />
      </Box>
    </Grid>
  );
}

export default Home;
